(1, 'Inventarios de Aceites', 'select  \r\nIdAceiteLote,\r\nTipo,\r\n\r\n\r\n\'<a href=\"app_detalles.php?id=\' +  CONVERT(varchar(50), IdAceiteLote) + \'&tipo=\' + CONVERT(varchar(50), Tipo) + \'&var1=\' + CONVERT(varchar(50), IdAceiteLote) + \'&back=1\"  class=\"icon\"><img src=\"icon/info.png\"></a> \' as Info,\r\n\'<a href=\"app_vender.php?id=\' +  CONVERT(varchar(50), IdAceiteLote) + \'&tipo=\' + CONVERT(varchar(50), Tipo) + \'&var1=\' + CONVERT(varchar(50), IdAceiteLote) + \'&back=1\"  class=\"icon\"><img src=\"icon/check3.png\"></a> \' as Vender,\r\n\r\n\r\nISNULL(Fruta, \'\') as Fruta,\r\nISNULL(Fecha,\'\') as Fecha,\r\nISNULL(Lote,\'\') as Lote,\r\nISNULL(Aldehidos,0) as Aldehidos,\r\nEnvasado,\r\nProduccion,\r\nUtilizados,\r\nInventarioFinal,\r\nEstatus,\r\nTiempoAlmacen,\r\nISNULL(KgMezcla,\'\') as KgMezcla,\r\nISNULL(ValorDeUnidad,0) as ValordeUnidad,\r\nUnidadDeMedida\r\n\r\n\r\nfrom InventarioDeAceites(\'Kilogramos\', 1 )', '', '', 'Lista de Productos Aceites', 'root', '2020-10-13', '20:00:07', 'L', 1, 'root', 2, '0', 1, 0, 'text', '', 0, 'text', '', 0, 'text', '', '', '', '', '', 1, 1, 1, 4, 0, 1),
